import React, { useEffect, useState } from 'react';
import hallway from '../Images/Hallway_Background.jpg';
import { useAuthState } from 'react-firebase-hooks/auth';
import { Link, useNavigate } from 'react-router-dom';
import {
  auth,
  registerWithEmailAndPassword,
  // signInWithGoogle,
} from '../FirebaseSetup/firebase';

export default function Register() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [name, setName] = useState("");
  const [birthday, setBirthday] = useState("");
  const [age, setAge] = useState("");
  const [condition, setCondition] = useState("");
  const [user, loading, error] = useAuthState(auth);
  const navigate = useNavigate();

  const register = () => {
    if (!name) alert("Please enter name");
    registerWithEmailAndPassword(name, email, password, birthday, age, condition);
  };

  useEffect(() => {
    if (loading) return;
    if (user) navigate("/userdashboard");
  }, [user, loading]);
  
  return (
  <div>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/flowbite/1.6.5/datepicker.min.js"></script>
    <img src={hallway} alt="hallway background" className="fixed top-[20px] w-[1550px] h-full bg-cover blur-[2px]" />
    <div className="register">
      <div className="register-container">
        <div className="login-form">
        <h3 className="register-title mx-auto">REGISTER</h3>
        <div className="flex space-x-[24px]">
          <div>
            <label>
              Full Name
              <input
              type="text"
              className="text-black"
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Full Name"
              />
        
              Email Address
              <input
              type="email"
              className="text-black"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Email Address"
              />
        
              Password
              <input
              type="password"
              className="text-black"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Password"
              />
            </label>
          </div>

          <div>
            <label>
              Birth Date
              {/* <input */}
              <div class="relative max-w-sm">
              <div class="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                <svg aria-hidden="true" class="w-5 h-5 text-gray-500 dark:text-gray-400" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" d="M6 2a1 1 0 00-1 1v1H4a2 2 0 00-2 2v10a2 2 0 002 2h12a2 2 0 002-2V6a2 2 0 00-2-2h-1V3a1 1 0 10-2 0v1H7V3a1 1 0 00-1-1zm0 5a1 1 0 000 2h8a1 1 0 100-2H6z" clip-rule="evenodd"></path></svg>
              </div>
              <input datepicker type="text" class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full pl-10 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Select date" />
            </div>
              type="text"
              className="text-black"
              value={birthday}
              onChange={(e) => setBirthday(e.target.value)}
              placeholder="Birth Date"
              {/* /> */}

              Age
              <input
              type="text"
              className="text-black"
              value={age}
              onChange={(e) => setAge(e.target.value)}
              placeholder="Age"
              />

              Condition
              <input
              type="text"
              className="text-black"
              value={condition}
              onChange={(e) => setCondition(e.target.value)}
              placeholder="Condition"
              />
            </label>
          </div>
        </div>

        <div className="grid place-items-center">
        <p>Already have an account? <Link to="/login" className="underline hover:text-stone-400">Sign in now!</Link></p>
        <button className="gen-button register-buttons" onClick={register}>
          REGISTER
        </button>
        {/* <button className="register-buttons" onClick={signInWithGoogle}>
          REGISTER WITH GOOGLE
        </button> */}
        </div>
        
        </div>
      </div>
    </div>
  </div>
  );
}
